import { forwardRef, SVGProps } from 'react';
import styled from 'styled-components';

const IconContainer = styled.div`
  width: 150px;
  height: 154px;
  overflow: visible;
  @keyframes upAndDown {
    0% {
      transform: translateY(0px);
    }
    50% {
      transform: translateY(4px);
    }
    100% {
      transform: translateY(0px);
    }
  }

  @keyframes showUp {
    0% {
      opacity: 0;
    }
    100% {
      opacity: 1;
    }
  }

`;

interface InstagramIconProps {
  profileSrc?:string;
  instaLogo?:boolean;
  onInstaClick?:()=>void;
}

export const InstagramIconRequest = forwardRef<HTMLDivElement|null, InstagramIconProps>(({ 
  profileSrc, 
  instaLogo,
  onInstaClick,
}, ref) => (
  <IconContainer ref={ref}>
    <DefaultProfile active={profileSrc === 'ok'} />
    {profileSrc && profileSrc !== 'temp' && <Profile url={profileSrc} />}
    {instaLogo && <InstaLogo onClick={onInstaClick} />}
  </IconContainer>
));

InstagramIconRequest.displayName = 'InstagramIconRequest';

const ProfileContainer = styled.div``;

function Profile({ url }:{url:string;}) {
  return (
    <ProfileContainer style={{
      width: '150px',
      height: '150px',
      borderRadius: '50%',
      overflow: 'hidden',
      animation: 'upAndDown infinite 3s, showUp 2s',
    }}
    >
      <img src={url} width={150} height={150} style={{ width: '100%' }} alt='insta_profile' />
    </ProfileContainer>
  );
}

